import img1Src from '../assets/img1.png'
import img2Src from '../assets/img2.png'
import img3Src from '../assets/img3.png'
// or you can put assets into public and then use /
function App() {
    return (
    <>
        <Page 
        img = {img1Src}
        name = 'Japan 🎌'
        />
        <Page
        img = {img2Src}
        name = 'America 🌠'
        />
        <Page 
        img = {img3Src}
        name = 'fantacy 🌏'
        />
        <Page 
        img = {img1Src}
        name = 'fan'
        />
    </>
        
    )
}

export default App
